import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input and add product to wishlist
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Apple iPhone 15 Pro Max, 256GB, Natural Titanium');
    await page.click('.search-btn');

    // Wait for product to be visible and click on it
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');

    // Wait for the add to wishlist button and click it
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.click('.add-to-wishlist');

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_wishlist.png'));

    return {
      success: true,
      action: "Product added to wishlist successfully",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
